- (BOOL)application:(UIApplication *)application didFinishLaunchingWithOptions:(NSDictionary *)launchOptions {

    cocos2d::Application *app = cocos2d::Application::getInstance();
    app->initGLContextAttrs();
    cocos2d::GLViewImpl::convertAttrs();
    float s = [UIScreen mainScreen].scale;
    CGRect r = [UIScreen mainScreen].bounds;
    
    if (r.size.width*s ==2436 && r.size.height*s ==1125) {
        _window = [[UIWindow alloc] initWithFrame: CGRectMake(32, 0, 780, 375)];
    }else{
        _window = [[UIWindow alloc] initWithFrame: [UIScreen mainScreen].bounds];
    }
    CCEAGLView *eaglView = [CCEAGLView viewWithFrame: [_window bounds]
                                     pixelFormat: (NSString*)cocos2d::GLViewImpl::_pixelFormat
                                     depthFormat: cocos2d::GLViewImpl::_depthFormat
                              preserveBackbuffer: NO
                                      sharegroup: nil
                                   multiSampling: NO
                                 numberOfSamples: 0 ];

    [eaglView setMultipleTouchEnabled:YES];
    
    // Use RootViewController manage CCEAGLView
    viewController = [[RootViewController alloc] initWithNibName:nil bundle:nil];
    viewController.wantsFullScreenLayout = YES;
    viewController.view = eaglView;

    // Set RootViewController to window
    if ( [[UIDevice currentDevice].systemVersion floatValue] < 6.0) {
        // warning: addSubView doesn't work on iOS6
        [_window addSubview: viewController.view];
    } else {
        // use this method on ios6
        [_window setRootViewController:viewController];
    }
    
    [_window makeKeyAndVisible];

    [[UIApplication sharedApplication] setStatusBarHidden: YES];
    [[UIApplication sharedApplication] setIdleTimerDisabled:YES];

    [BuglyAgent class]; // only for load library
    [Bugly sdkVersion]; // only for load library    
    [Bugly startWithAppId:nil];
    
    // IMPORTANT: Setting the GLView should be done after creating the RootViewController
    cocos2d::GLView *glview = cocos2d::GLViewImpl::createWithEAGLView(eaglView);
    cocos2d::Director::getInstance()->setOpenGLView(glview);
  
    app->run();
    
    // --- sdk begins - 39zy ---
    [[OrzOSDK getSharedInstance] application:application didFinishLaunchingWithOptions:launchOptions];
    // --- sdk ends ---
    
    
    
    return YES;
}


